"use strict";

console.log("========== Arithmetic Operator =============");
var numOne = 10;
var numTwo = 5;
var result = numOne + numTwo;
console.log("Addition Result is :".concat(result));
var result = numOne - numTwo;
console.log("Subtraction Result is :".concat(result));
var result = numOne * numTwo;
console.log("Multiplication Result is :".concat(result));
var result = Math.pow(numOne, 3);
console.log("Exponential Result is :".concat(result));
var result = numOne / 3;
console.log("Division Result is :".concat(result));
var result = numOne % 4;
console.log("Reminder Result is :".concat(result));